import "./../main.scss";
import React, {useState, useEffect} from 'react';
import {useForm} from 'react-hook-form';
import Modal from 'react-modal';

import CounterTent from './CounterTent.js';
import CounterBag from './CounterBag.js';
import CounterRug from './CounterRug.js';
import CounterSet from './CounterSet.js';



import "./../index.js" 







const Form = () => {
  const [IsOpen, setOpen] = useState();

  
  
  


  const open = () => {
    setOpen(true);
  };
  
  const close = () => {
    setOpen(false);
  };

  const [tent, setTent] = useState("");
  const [bag, setBag] = useState("");
  const [rug, setRug] = useState("");
  const [set, setSet] = useState("");
  const [days, setDays] = useState("");
  const [date, setDate] = useState("");
  const [name, setName] = useState("");
  const [tel, setTel] = useState("");

  const [data, setData] = useState([]);
 

const {register, formState: {errors}, handleSubmit, setError} = useForm();

const onSubmit = async (data) => {
  try {
  alert(`Забронировано успешно!
    Назовите свой номер ${tel} в пункте выдачи для получения оборудования`);
  console.log(JSON.stringify(data))
}
catch(e) {
  setError('service', {type: "Error", message: "Something goes wrong"})
}
}


const onError = () => {
  console.log("Не заполнено поле");
};


useEffect(() => {
  fetch("http://localhost:8000/camp")
    .then(data => data.json())
    .then(data => console.log(data));
}, []);


const Submit = (event) => {
  event.preventDefault();
  fetch("http://localhost:8000/camp", {
    method: "POST", 
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({tent, bag, rug, set, days, date, name, tel}),
  })
  .then((response) => response.json())
  .then((data) => {
    setData(data);
  
    })
    .catch((error) => {
      console.error("Error:", error);
    });
};

console.log(Array.isArray(data))





  const Content = (


    
  <form action="" method='post' onSubmit = {handleSubmit(onSubmit, onError, Submit)} >
    <fieldset>
      <div className='block'>
      <p>Палатка:</p> 
      <select value={tent} onChange={(e) => setTent(e.target.value)} name="tent" id="1">
        <option defaultValue="n2">Двухместная</option>
        <option defaultValue="n3">Трехместная</option>
      </select>
        <CounterTent/>
      </div>
      <div className='block'>
      <p>Спальный мешок:</p>
      <select value={bag} onChange={(e) => setBag(e.target.value)} name="bag" id="2">
        <option defaultValue="m1">Спальный мешок +10</option>
        <option defaultValue="m2">Спальный мешок 0</option>
        <option defaultValue="m3">Спальный мешок -18</option>
      </select>
      <CounterBag/>
    </div>
    <div className='block'>
      <p>Коврик:</p> 
      <select value={rug} onChange={(e) => setRug(e.target.value)} name="rug" id="3">
        <option defaultValue="p1">Коврик пенный</option>
        <option defaultValue="p2">Коврик туристический</option>
      </select>
      <CounterRug/>
    </div>
    <div className='block'>
      <p>Набор:</p> 
      <select value={set} onChange={(e) => setSet(e.target.value)} name="set" id="4">
        <option defaultValue="r1">Для одного</option>
        <option defaultValue="r2">Для двоих</option>
        <option defaultValue="r3">Для троих</option>
      </select>
      <CounterSet/>
    </div>

      <p>Количество дней:</p>
      <select value={days} onChange={(e) => setDays(e.target.value)} name="days" id="5">
        <option defaultValue="k1">1</option>
        <option defaultValue="k2">2</option>
        <option defaultValue="k3">3</option>
        <option defaultValue="k4">4</option>
        <option defaultValue="k5">5</option>
        <option defaultValue="k6">6</option>
        <option defaultValue="k7">7</option>
      </select>
      <p>
        Выберите дату получения:
        <input value={date} onChange={(e) => setDate(e.target.value)}
          type="date"
          name="data"
          defaultValue="2024-03-20"
          max="2024-08-31"
          min="2024-03-20"
          id="6"
          ></input>
      </p>
      <label >Имя: </label>
      <input value={name} {...register("name", {required: true})} type="text" id="nameId" name="name" placeholder="Введите имя" onChange={(e) => setName(e.target.value)}></input>
      
      <label >Телефон (Пример: +79000000000): </label>
      <input value={tel} {...register("tel", {required: true})} id="telId" name="tel" placeholder="Введите номер телефона" size="15" required onChange={(e) => setTel(e.target.value.replace(/\D+/g, ''))}></input>
      <div>{errors?.tel && <p>{errors?.tel?.message || "Error"}</p>}</div>


      <button type="submit" className="btn2">Отправить</button>
      <button onClick={close} className="btn2">Закрыть</button>
    </fieldset>
  </form>

      
   
  );
 
  return (
    <div>
      <button onClick={open} className="btn1">Забронировать</button>
      <Modal isOpen={IsOpen} onRequestClose={close} ariaHideApp={false}>
        {Content}
      </Modal>
    </div>
  );
}


export default Form;
